import React, { useState } from 'react';

const Card = ({ firstName, lastName, email }) => {
  const [name, setName] = useState(firstName);
  const handleChange = (e) => {
    setName(e.target.value);
    console.log(name);
  };
  return (
    <div className='card'>
      <input
        type='text'
        value={name}
        onChange={(e) => setName(e.target.value)}
      />
      <p>{firstName}</p>
      <p>{lastName}</p>
      <p>{email}</p>
      <button>Edit</button>
    </div>
  );
};

export default Card;
